import React from 'react';
import Header from '../components/Header';
import Sidebar from '../components/Sidebar';
import Footer from '../components/Footer';
import { useNavigate } from 'react-router-dom';

const AddManageDevice = ({ userInfo, handleLogout }) => {
    const navigate = useNavigate();

    const backManageDevice = () => {
        navigate('/superadmin/ManageDevice'); // Replace '/next-page' with your target route
    };

    // Update profile
    const [chargerID, setChargerID] = useState('');
    const [transactionID, setTransactionID] = useState('');
    const [tagID, setTagID] = useState('');
    const [model, setModel] = useState('');
    const [type, setType] = useState('');
    const [vendor, setVendor] = useState('');
    const [gunConnetor, setGunConnetor] = useState('');
    const [maxCurrent, setMaxCurrent] = useState('');
    const [maxPower, setMaxPower] = useState('');
    const [socketCount, setsocketCount] = useState('');
    const [currentOrActiveUser, setCurrentOrActiveUser] = useState('');
    const [ip, setIP] = useState('');
    const [lat, setLat] = useState('');
    const [long, setLong] = useState('');
    const [shortDescription, setShortDescription] = useState('');
    const [chargerAccessibility, setChargerAccessibility] = useState('');
    const [unitPrice, setUnitPrice] = useState('');
    const [assignedUser, setAssignedUser] = useState('');
    const [assignedResellerID, setAssignedResellerID] = useState('');
    const [assignedClientID, setAssignedClientID] = useState('');
    const [wifiPassword, setWifiPassword] = useState('');
    const [createdDate, setCreatedDate] = useState('');
    const [createdBy, setCreatedBy] = useState('');
    const [modifiedDate, setModifiedDate] = useState('');
    const [modifiedBy, setModifiedBy] = useState('');
    const [status, setStatus] = useState('');
    const [errorMessage, setErrorMessage] = useState('');

    const addManageDevice = async (e) => {
        alert(  JSON.stringify({ updateUname, updateEmail, updatePhone, updatePassword }), 'add charger all data' );
        e.preventDefault();
        try {
            const response = await fetch('http://192.168.1.70:9090/GetAllinputData', {
            method: 'POST',
            headers: {
                'Content-Type': 'application/json',
            },
            body: JSON.stringify({ updateUname, updateEmail, updatePhone, updatePassword }),
            });
            alert(  JSON.stringify({ updateUname, updateEmail, updatePhone, updatePassword }), 'add charger all data' );
            if (response.ok) {
                alert('Charger added successfully');
                // Clear the input after successful submission if needed
                setChargerID(''); 
                setTransactionID(''); 
                setTagID(''); 
                setModel(''); 
                setType(''); 
                setVendor(''); 
                setGunConnetor(''); 
                setMaxCurrent(''); 
                setMaxPower(''); 
                setsocketCount(''); 
                setCurrentOrActiveUser(''); 
                setIP(''); 
                setLat(''); 
                setLong(''); 
                setShortDescription(''); 
                setChargerAccessibility(''); 
                setUnitPrice(''); 
                setAssignedUser(''); 
                setAssignedResellerID(''); 
                setAssignedClientID(''); 
                setWifiPassword(''); 
                setCreatedDate(''); 
                setCreatedBy(''); 
                setModifiedDate(''); 
                setModifiedBy(''); 
                setStatus(''); 
            } else {
                setErrorMessage('Failed to add charger');
            }
        }catch (error) {
                setErrorMessage('An error occurred while adding the charger');
                console.error('Error:', error);
        }
    };
    // Add Chargers end
    return (
        <div className='container-scroller'>
            {/* Header */}
            {/* <Header/> */}
            <Header userInfo={userInfo} handleLogout={handleLogout}/>
            <div className="container-fluid page-body-wrapper">
                {/* Sidebar */}
                <Sidebar/>
                <div className="main-panel">
                    <div className="content-wrapper">
                        <div className="row">
                            <div className="col-md-12 grid-margin">
                                <div className="row">
                                    <div className="col-12 col-xl-8 mb-4 mb-xl-0">
