                                        </div>
                                    </div>
                                </div>
                            </div>
                        </div>
                        <div className="row">
                            <div className="col-lg-12 grid-margin stretch-card">
                                <div className="card">
                                    <div className="card-body">
                                        <div class="col-12 grid-margin">
                                            <div class="card">
                                                <div class="card-body">
                                                    <h4 class="card-title">Manage Device</h4>
                                                    <form class="form-sample" onSubmit={addManageDevice}>
                                                        <div class="row">
                                                            <div class="col-md-6">
                                                                <div class="form-group row">
                                                                    <label class="col-sm-3 col-form-label">Charger ID</label>
                                                                    <div class="col-sm-9">
                                                                        <input type="text" class="form-control" placeholder="Charger ID" value={chargerID}  onChange={(e) => setChargerID(e.target.value)} required/>
