                                                                        <input type="text" class="form-control" placeholder="Model" value={model}  onChange={(e) => setModel(e.target.value)} required/>
                                                                    </div>
                                                                </div>
                                                            </div>
                                                        </div>
                                                        <div class="row">
                                                            <div class="col-md-6">
                                                                <div class="form-group row">
                                                                    <label class="col-sm-3 col-form-label">Type</label>
                                                                    <div class="col-sm-9">
                                                                        <input type="text" class="form-control" placeholder="Type" value={type}  onChange={(e) => setType(e.target.value)} required/>
                                                                    </div>
                                                                </div>
                                                            </div>
                                                            <div class="col-md-6">
                                                                <div class="form-group row">
                                                                    <label class="col-sm-3 col-form-label">Vendor</label>
                                                                    <div class="col-sm-9">
                                                                        <input type="text" class="form-control" placeholder="Vendor" value={vendor}  onChange={(e) => setVendor(e.target.value)} required/>
                                                                    </div>
                                                                </div>
