                                                                    </div>
                                                                </div>
                                                            </div>
                                                        </div>
                                                        <div class="row">
                                                            <div class="col-md-6">
                                                                <div class="form-group row">
                                                                    <label class="col-sm-3 col-form-label">Wifi Password</label>
                                                                    <div class="col-sm-9">
                                                                        <input type="text" class="form-control" placeholder="Wifi Password" value={wifiPassword}  onChange={(e) => setWifiPassword(e.target.value)} required/>
